const SideBar = () => {
  return (
    <>
      <Drawer.Navigator
        drawerContent={(props) => {
          return (
            <SafeAreaView>
              <View
                style={{
                  height: 100,
                  width: '100%',
                  justifyContent: 'center',
                  paddingLeft: 23,
                  borderBottomColor: '#f4f4f4',
                  borderBottomWidth: 1,
                }}
              >
                <SvgXml xml={logo} width="150px" height="150px" />
              </View>
              <DrawerItemList {...props} />
            </SafeAreaView>
          );
        }}
        screenOptions={{
          drawerStyle: {
            backgroundColor: '#232325',
            width: 250,
          },

          drawerLabelStyle: {
            color: '#6E6E6E',
          },
          drawerActiveTintColor: '#fff',
        }}
        initialRouteName="Recommendations"
      >
        <Drawer.Screen
          name="Recommendations"
          options={{
            headerShown: false,
            drawerLabel: 'Рекомендации',
            title: 'Рекомендации',
            drawerIcon: () => <SvgXml xml={home} width="25px" height="25px" />,
          }}
          component={Recommendations}
        />
        <Drawer.Screen
          name="Chats"
          options={{
            headerShown: false,
            drawerLabel: 'Чаты',
            title: 'Чаты',
            drawerIcon: () => <SvgXml xml={msg} width="25px" height="25px" />,
          }}
          component={Chats}
        />
        <Drawer.Screen
          name="Likes"
          options={{
            headerShown: false,
            drawerLabel: 'Лайки',
            title: 'Лайки',
            drawerIcon: () => (
              <SvgXml xml={people} width="25px" height="25px" />
            ),
          }}
          component={Likes}
        />
        <Drawer.Screen
          name="ProfileEdit"
          options={{
            headerShown: false,
            drawerLabel: 'Мои мероприятия',
            title: 'Мои мероприятия',
            drawerIcon: () => (
              <SvgXml xml={events} width="25px" height="25px" />
            ),
          }}
          component={ProfileEdit}
        />
        <Drawer.Screen
          name="Profile"
          options={{
            headerShown: false,
            drawerLabel: 'Профиль',
            title: 'Профиль',
            drawerIcon: () => <SvgXml xml={user} width="25px" height="25px" />,
          }}
          component={Profile}
        />
        <Drawer.Screen
          name="Gallery"
          options={{
            headerShown: false,
            drawerLabel: 'Уведомления',
            title: 'Уведомления',
            drawerIcon: () => (
              <SvgXml xml={notifications} width="25px" height="25px" />
            ),
          }}
          component={Gallery}
        />
        <Drawer.Screen
          name="Settings"
          options={{
            drawerLabel: 'Настройки',
            title: 'Настройки',
            drawerIcon: () => (
              <SvgXml xml={settings} width="25px" height="25px" />
            ),
          }}
          component={Settings}
        />
      </Drawer.Navigator>
    </>
  );
};

export default SideBar;
